import React from "react";
import './App.css';
const Square = ({value}) => {
  function handleClick(){
    console.log("Clicado!")
  }
  return (
  <button 
  className="square"
  onClick={handleClick}
  >{value}</button> 
)
}

const Board = () => {
  return (
    <div className="container">
      <h1>Jogo da Velha</h1>
      <div className="board-row">
        <Square value="1" />
        <Square value="2" />
        <Square value="3" />
      </div>
      <div className="board-row">
        <Square value="4" />
        <Square value="5" />
        <Square value="6" />
      </div> 
      <div className="board-row">
        <Square value="7" />
        <Square value="8" />
        <Square value="9" />
      </div>        
    </div>
  );
};

export default Board;
